"""
Input: nums = [1,1,0,1,1,1]
Output: 3
Explanation: The first two digits or the last three digits are consecutive 1s. The maximum number of consecutive 1s is 3.
"""
def max_consecutive_one(nums: list[int]):
    max_one = 0
    temp = 0
    for i in range(len(nums)):
        if nums[i] == 1:
            max_one += 1
        elif nums[i] != 1:
            if max_one > temp:
                temp = max_one
            max_one = 0
    if temp > max_one:
        max_one = temp
    return max_one

